		/**
		 * Returns array of two items - min and max values. [min, max].
		 * Should be applied only to Numbers.
		 * @param {Array} arr Array of numbers, we are working with
		 * @return {Array} Array of two numbers - min and max values
		 */
		function getMinMax(arr) {
			return [Math.min(...arr), Math.max(...arr)];
		}
		/**
		 * Changes array values according to minimum and maximum values
		 * in etalon array.
		 * @param {Array} minMax Minimum and maximum values from etalon array
		 * @param {Array} arr Array we need to reformat according to minMax values.
		 * @return {Array} Reformated array
		 */
		function reformatArray(minMax, arr){
			var arrMinMax = getMinMax(arr); 
			var coef      = (minMax[1] - minMax[0]) / (arrMinMax[1] - arrMinMax[0]);
			
			return arr.map(function (el) {
				return (el - arrMinMax[0]) * coef + minMax[0];
			});
		}
		/**
		 * Prepares raw data, obtained from Manager
		 * @param {Array} Array of raw data objects
		 * @return {Object} One population object
		 */
		function prepareRawData(rawData) {
			var i;
			var res = {
				"Probabilities"       : [],
				"Amount of functions" : [],
				"Functions calls"     : [],
				"Mutations on clone"  : [],
				"Mutations period"    : [],
				"Mutations amount"    : [],
				"Energy"              : [],
				"for operators"       : [],
				"if operators"        : [],
				"getEnergy"           : [],
				"Memory reading"      : [],
				"Eating"              : [],
				"Moving"              : [],
				"Amount of lines"     : [],
				"Amount of organisms" : [],
				"IPS"                 : [],
				"World energy"        : [],
				"Generation number"   : []
			};
			
			for (i = 0; i < rawData.length; i++) {
				res["Probabilities"].push(rawData[i]["Probabilities"]);
				res["Amount of functions"].push(rawData[i]["Amount of functions"]);
				res["Functions calls"].push(rawData[i]["Functions calls"]);
				res["Mutations on clone"].push(rawData[i]["Mutations on clone"]);
				res["Mutations period"].push(rawData[i]["Mutations period"]);
				res["Mutations amount"].push(rawData[i]["Mutations amount"]);
				res["Energy"].push(rawData[i]["Energy"]);
				res["for operators"].push(rawData[i]["for operators"]);
				res["if operators"].push(rawData[i]["if operators"]);
				res["getEnergy"].push(rawData[i]["getEnergy"]);
				res["Memory reading"].push(rawData[i]["Memory reading"]);
				res["Eating"].push(rawData[i]["Eating"]);
				res["Moving"].push(rawData[i]["Moving"]);
				res["Amount of lines"].push(rawData[i]["Amount of lines"]);
				res["Amount of organisms"].push(rawData[i]["Amount of organisms"]);
				res["IPS"].push(rawData[i]["IPS"]);
				res["Generation number"].push(rawData[i]["Generation number"]);
			}
			
			return res;
		}
		/**
		 * Creates as many charts data as many arguments we pass in
		 * @param {Boolean} trends Show trends only (original values will be changed).
		 * false - original values will be showed.
		 * @param {Array} indexArr X coordinate data array
		 * @param {Array} etalonArr Charts data arrays. First argument should be
		 * with maximum values comparing with others.
		 */
		function createCharts(trends, indexArr, etalonArr) {
			var data         = Array.prototype.slice.call(arguments);
			var result       = [];
			var etalonMinMax = getMinMax(etalonArr);
			var minMax;
			var arr;
			var i;
			var j;
			
			data.shift(); // removes trends
			data.shift(); // removes indexArr
			for (i = 0; i < indexArr.length; i++) {
				//
				// Value from etalon array. We don't need to change it.
				//
				arr = [indexArr[i]];
				if (arr !== undefined) {
					for (j = 0; j < data.length; j++) {
						if (trends) {
							arr.push(reformatArray(etalonMinMax, [].concat(data[j]))[i]);
						} else {
							arr.push(data[j][i]);
						}
					}
					result.push(arr);
				}
			}
			return result;
		}
		/**
		 * Prepares data for drawing. dataArr is an array of field names like
		 * 'Population', 'Energy' and so on... It's important, that first two
		 * items of this array should be:
		 * 0 - name of X coordinate
		 * 1 - etalon array
		 * 2... - other data arrays
		 * @param {Boolean} trends true if we want to show a trend charts
		 * @param {DataTable} dataTable google charts DataTable object
		 * @param {Object} options Chart options
		 * @param {Object} population One population objects with all the fields
		 * @param {Array} dataArr Array of field names, which should be in chart
		 */
		function initData(trends, dataTable, options, population, dataArr) {
			var i;
			var chartsArr = [trends, population[dataArr[1]]];
			
			options.trendlines = {};
			dataTable.addColumn('number', dataArr[0]);
			for (i = 2; i < dataArr.length; i++) {
				dataTable.addColumn('number', dataArr[i]);
				chartsArr.push(population[dataArr[i]]);
				options.trendlines[i - 2] = {
					type: 'polynomial',
					lineWidth: 3
				}
			}
			
			dataTable.addRows(createCharts.apply(null, chartsArr));
		}
		/**
		 * Draws charts one by one according to data...
		 */
		function drawCharts() {
			var data = new google.visualization.DataTable();
			var rawData = getRawData();
			//var populations = getPopulations();
			var populations = [prepareRawData(getRawData())];
			//
			// Charts related options
			//
			var options = {
				hAxis: {
					title: 'Population age',
					gridlines: {
						count: 10,
						color: '#eee'
					}
				},
				vAxis: {
					//title: 'Amount'
					gridlines: {
						count: 10,
						color: '#eee'
					}
				},
				lineWidth: 1,
				chartArea:{ left: '5%', top: '2%', width: "80%", height: "88%" },
				//curveType: 'function',
				//pointsVisible: true,
				//pointSize: 1,
				dataOpacity: 0.6
			};
			//
			// First two arguments are: X coordinate array and etalon array
			//
			//initData(true, data, populations[0], ['Population age', 'Generation number', 'Energy', 'Functions calls', 'Mutations amount', 'Amount of lines']);
			initData(false, data, options, populations[0], ['Population age', 'Generation number', "Eating", "getEnergy", "if operators", "for operators"]);
			//
			// Draw charts in DOM
			//
			var chart = new google.visualization.LineChart(document.getElementById('chart_div'));
			chart.draw(data, options);
		}
    </script>

    <div id="chart_div" style="width: 100%; height: 100%"></div>
